import React, { useEffect, useState } from "react";
import Header from "../components/Header";
import { useNavigate, useParams } from "react-router-dom";
import axios from "axios";
import "./ProfileEdit.css";

function ProfileEdit() {
  const navigate = useNavigate();
  const { user_id } = useParams();
  const [formData, setFormData] = useState({
    nickname: "",
    email: "",
    password: "",
    confirmPassword: "",
    role: [],
  });

  useEffect(() => {
    // Fetch user data and set form data
    axios
      .get(`/dailband/user/${user_id}/profile`)
      .then((response) => {
        setFormData(response.data);
      })
      .catch((error) => {
        console.error("There was an error fetching the user data!", error);
      });
  }, [user_id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    if (type === "checkbox") {
      setFormData((prevData) => ({
        ...prevData,
        role: checked
          ? [...prevData.role, value]
          : prevData.role.filter((role) => role !== value),
      }));
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      alert("Passwords do not match!");
      return;
    }

    axios
      .put(`/dailband/user/${user_id}/profile`, formData)
      .then(() => {
        navigate(`/profile/${user_id}`);
      })
      .catch((error) => {
        console.error("There was an error updating the profile!", error);
      });
  };

  return (
    <div>
      <Header />
      <div className="ProfileEditPage">
        <div className="Sidebar">
          <div className="Username">윤영선</div>
          <div className="MenuItem">프로필 수정</div>
          <div className="MenuItem">스크랩</div>
          <div className="MenuItem">내가 쓴 글</div>
          <div className="MenuItem">공연 예약</div>
        </div>
        <div className="ProfileContainer">
          <div className="TitleEdit">마이페이지</div>
          <form onSubmit={handleSubmit} className="InputEdit">
            <input
              placeholder="닉네임"
              name="nickname"
              value={formData.nickname}
              onChange={handleChange}
            />
            <input
              placeholder="이메일"
              name="email"
              value={formData.email}
              onChange={handleChange}
            />
            <input
              type="password"
              placeholder="비밀번호 변경"
              name="password"
              value={formData.password}
              onChange={handleChange}
            />
            <input
              type="password"
              placeholder="비밀번호 확인"
              name="confirmPassword"
              value={formData.confirmPassword}
              onChange={handleChange}
            />
            <div className="CheckboxGroup">
              <label>
                <input
                  type="checkbox"
                  name="role"
                  value="드럼"
                  checked={formData.role.includes("드럼")}
                  onChange={handleChange}
                />
                드럼
              </label>
              <label>
                <input
                  type="checkbox"
                  name="role"
                  value="기타"
                  checked={formData.role.includes("기타")}
                  onChange={handleChange}
                />
                기타
              </label>
              <label>
                <input
                  type="checkbox"
                  name="role"
                  value="보컬"
                  checked={formData.role.includes("보컬")}
                  onChange={handleChange}
                />
                보컬
              </label>
              <label>
                <input
                  type="checkbox"
                  name="role"
                  value="베이스"
                  checked={formData.role.includes("베이스")}
                  onChange={handleChange}
                />
                베이스
              </label>
              <label>
                <input
                  type="checkbox"
                  name="role"
                  value="키보드"
                  checked={formData.role.includes("키보드")}
                  onChange={handleChange}
                />
                키보드
              </label>
            </div>
            <button type="submit" className="EditSubmit">
              수정
            </button>
          </form>
        </div>
      </div>
      <div className="Background">
        <img alt="background" src="img/배경사진.jpg" />
      </div>
    </div>
  );
}

export default ProfileEdit;
